// src/pages/Home.js
import React, { useEffect, useState } from 'react';

function Home() {
  const [userData, setUserData] = useState(null);

  // Fetch user data when the component loads
  useEffect(() => {
    async function fetchUserData() {
      try {
        // Replace this with your actual API endpoint or data fetching logic
        const response = await fetch('/api/getUser'); // Example endpoint
        const data = await response.json();
        setUserData(data);
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    }

    fetchUserData();
  }, []);

  return (
    <div className="bg-black text-white h-screen flex flex-col justify-center items-center font-sans">
      <h1 className="text-4xl font-bold text-purple-500 mb-6">Welcome to the Home Page!</h1>
      {userData ? (
        <div className="flex flex-col items-center bg-purple-800 p-6 rounded-lg shadow-lg">
          <h2 className="text-2xl font-semibold mb-4">User Details</h2>
          <p className="text-lg">
            <span className="font-bold text-purple-300">Username: </span>
            {userData.username}
          </p>
          <p className="text-lg">
            <span className="font-bold text-purple-300">Email: </span>
            {userData.email}
          </p>
          <p className="text-lg">
            <span className="font-bold text-purple-300">Role: </span>
            {userData.role}
          </p>
        </div>
      ) : (
        <p className="text-gray-400">Loading user data...</p>
      )}
    </div>
  );
}

export default Home;
